import { Routes } from 'react-router-dom';

function App(){
 return(
   <div>
      <Router>
        <Routes>
          <Route path="/" element={<LoginPage/>}></Route>
          <Route path="/doctorShare" element={<doctorShare/>}></Route>
        </Routes>     
      </Router>
   </div>

 )
}
export default App;
